combination = """



"""

# keypad
#     1
#   2 3 4
# 5 6 7 8 9
#   A B C
#     D

keypad = [
    ["0", "0", "1", "0", "0"],
    ["0", "2", "3", "4", "0"],
    ["5", "6", "7", "8", "9"],
    ["0", "A", "B", "C", "0"],
    ["0", "0", "D", "0", "0"],
]

# combination = """
# ULL
# RRDDD
# LURDL
# UUUUD"""

combination = combination.split("\n")
combination = [row.strip() for row in combination]

x, y = 0, 2

combination_list = []

for row in combination:
    print(row)
    for move in row:
        if move == "U":
            y -= 1
            if y < 0 or keypad[y][x] == "0":
                y += 1
        elif move == "D":
            y += 1
            if y > 4 or keypad[y][x] == "0":
                y -= 1
        elif move == "R":
            x += 1
            if x > 4 or keypad[y][x] == "0":
                x -= 1
        else:  # move == 'L'
            x -= 1
            if x < 0 or keypad[y][x] == "0":
                x += 1
    combination_list.append(str(keypad[y][x]))
    print(combination_list)

print("".join(combination_list))
